import axios from "axios";

export const addUser = async (data) => {
  const url = "http://localhost:5001";
  try {
    await axios.post(`${url}/add`, data);
  } catch (e) {
    console.log(e);
  }
};

export const getUsers = async () => {
  try {
    await axios.get(`${url}/all`);
  } catch (e) {
    console.log(e);
  }
};
